import styled from "styled-components";

export const ModalStyle = styled.div`

    .modal {
        margin: 0;
        margin-left: 15%;
        width: 50vw;
        height: 90vh;
        border: solid 5px #222;
        background: #444;;
        z-index: 10;
        position: fixed;
        border-radius: 10px;
    }

`
